class State {
  String view = 'list';
  List<String> args = [];
  File upload = null;
}

typedef StateListener = void Function(State state);
List<StateListener> listeners = [];
var state = State();

void dispatch(Function update) {
  update(state);
  listeners.forEach((listener) => listener(state));
}

HtmlElement listViewWhale(String id) {
  DivElement element = DivElement();
  String sample = whales[id][0];
  element.className = 'whale';
  element.style.backgroundImage = 'url("/images/100x100/$sample")';
  AnchorElement link = AnchorElement();
  link.text = id;
  link.className = 'whale-link';
  link.href = '#!/whale/$id';
  element.children.add(link);
  return element;
}

HtmlElement listView(State state) {
  DivElement element = DivElement();
  whales.keys.forEach((whaleId) {
    element.children.add(listViewWhale(whaleId));
  });

  return element;
}

HtmlElement whaleViewWhale(String id) {
  DivElement element = DivElement();
  element.className = 'whale-view-container';
  whales[id].forEach((imageId) {
    DivElement imageContainer = DivElement();
    imageContainer.className = 'whale-image';
    ImageElement whale = ImageElement();
    whale.src = '/images/original/$imageId';
    imageContainer.children.add(whale);
    element.children.add(imageContainer);
  });
  return element;
}

HtmlElement whaleView(State state) {
  DivElement element = DivElement();
  HeadingElement heading = HeadingElement.h1();
  heading.text = '${state.args[0]} (${whales[state.args[0]].length})';
  element.children.add(heading);
  element.children.add(whaleViewWhale(state.args[0]));
  return element;
}

HtmlElement previewImage(State state) {
  DivElement element = DivElement();
  element.className = 'preview-image';
  ImageElement image = ImageElement();
  FileReader reader = FileReader();
  reader.onLoad.listen((_) {
    image.onLoad.listen((_) {
      //image.width = 224;
      //image.height = 224;

      var result = context['predict'].apply([
        image,
        allowInterop((prediction) {
          AnchorElement link = AnchorElement();
          HtmlElement results = document.getElementsByClassName('preview-results')[0];
          HeadingElement heading = HeadingElement.h2();
          String whaleId = prediction[0];
          heading.text = '${whaleId} (Probability: ${prediction[1]})';
          link.children.add(heading);
          link.href = '#!/whale/${whaleId}';
          results.children.add(link);
          DivElement container = DivElement();
          container.className = 'preview-results-thumbnails';
          whales[whaleId].forEach((String imageId) {
            DivElement imageContainer = DivElement();
            imageContainer.className = 'whale-image';
            ImageElement whale = ImageElement();
            whale.src = '/images/original/$imageId';
            imageContainer.children.add(whale);
            results.children.add(imageContainer);
          });
          results.children.add(container);
        }),
      ]);
    });

    image.src = reader.result;
  });
  reader.readAsDataUrl(state.upload);
  element.children.add(image);
  return element;
}

HtmlElement previewResults(State state) {
  DivElement element = DivElement();
  element.className = 'preview-results';
  return element;
}

HtmlElement uploadView(State state) {
  DivElement container = DivElement();
  container.className = 'preview-container';
  DivElement header = DivElement();
  header.className = 'preview-header';
  HeadingElement left = HeadingElement.h1();
  left.text = 'Uploaded';
  HeadingElement right = HeadingElement.h1();
  right.text = 'Best Match';
  header.children.add(left);
  header.children.add(right);
  DivElement element = DivElement();
  element.className = 'preview';
  element.children.add(previewImage(state));
  element.children.add(previewResults(state));
  container.children.add(header);
  container.children.add(element);
  return container;
}

void handleUpload(event) {
  List<File> files = event.target.files;
  if (files == null || files.isEmpty) {
    return;
  }

  dispatch((state) {
    state.upload = files[0];
  });

  window.location.hash = '!/upload';
}

void render(State state) {
  HtmlElement element;
  switch (state.view) {
    case 'list':
      element = listView(state);
      break;
    case 'whale':
      element = whaleView(state);
      break;
    case 'upload':
      element = uploadView(state);
      break;
  }

  element.id = 'container';
  HtmlElement body = querySelector('body');
  DivElement uploadButton = DivElement();
  uploadButton.className = 'upload';
  uploadButton.text = '+';
  InputElement upload = InputElement();
  upload.id = 'upload';
  upload.text = '+';
  upload.type = 'file';
  upload.onChange.listen(handleUpload);
  uploadButton.children.add(upload);
  body.children.clear();
  body.children.add(element);
  body.children.add(uploadButton);
}

void main() {
  listeners.add(render);
  window.onHashChange.listen((_) {
    var hash = window.location.hash;
    var parts = hash.split('/').sublist(1);
    dispatch((state) {
      state.view = parts[0];
      state.args = parts.sublist(1);
    });
  });
  window.location.hash = '!/list';
}
